import React from 'react'
import { withStyles, makeStyles, AppBar } from '@material-ui/core'

const useStyles = makeStyles({
    container: {
        width: "100%",
        height: "150px",
        position: "relative",
        bottom: 0,

    }
});
export default function Footer(props) {
    const classes = useStyles(props);
    return (
        <AppBar className={classes.container}>
            <div style={{
                flex: 1,
                width: "100%",
                height: 200,
                justifyContent: 'center',
                alignItems: 'center',
                padding: 0,
            }}>
                <div style={{
                    flex: 1,
                    width: 100,
                    height: "inherit",
                    minWidth: '50%',
                    paddingHorizontal: 20,
                }} >

                </div>
                <div style={{
                    flex: 1,
                    width: 100,
                    height: "inherit",
                    minWidth: '50%',
                    paddingHorizontal: 20,
                }} />
            </div>
        </AppBar>
    )
}
